import React, { Component } from 'react';

class ThankYou extends Component {
    render() {
        return (
            <div>
                <div className="container">
                <h1>Thank you for signing up!</h1>
                <h5 className="padding-bottom-15px">You can now log in</h5>
                </div>
            </div>
        );
    }
}

export default ThankYou;
